/**
 * Endpoint
 *
 * The technical details of an endpoint that can be used for electronic services,
 * such as for web services providing XDS.b, a REST endpoint for another FHIR
 * server, or a s/Mime email address. This may include any security context
 * information.
 *
 * @see {@link http://hl7.org/fhir/R5/Endpoint.html}
 */
export interface Endpoint extends DomainResource {
  readonly resourceType: "Endpoint";

  /**
 * The uri that describes the actual end-point to connect to.
 * For rest-hook, and websocket, the end-point must be an http: or https: URL; for
 * email, a mailto: url, for sms, a tel: url, and for message the endpoint can be
 * in any form of url the server understands (usually, http: or mllp:). The URI is
 * allowed to be relative; in which case, it is relative to the server end-point
 * (since there may be more than one, clients should avoid using relative
 * URIs)

This address will be to the service base, without any parameters, or
 * sub-services or resources tacked on.

E.g. for a WADO-RS endpoint, the url
 * should be "https://pacs.hospital.org/wado-rs"

and not
 * "https://pacs.hospital.org/wado-rs/studies/1.2.250.1.59.40211.12345678.678910/se
 * ries/1.2.250.1.59.40211.789001276.14556172.67789/instances/...".
 * @see {@link http://hl7.org/fhir/R5/Endpoint-definitions.html#Endpoint.address}
 */
  address: string;
  _address?: Element | undefined;

  /**
   * A coded value that represents the technical details of the usage of this
   * endpoint, such as what WSDLs should be used in what way. (e.g.
   * XDS.b/DICOM/cds-hook).
   * For additional connectivity details for the protocol, extensions will be used at
   * this point, as in the XDS example. If there are multiple payload types or
   * mimetypes they are all applicable for all connection types, and all have the
   * same status.
   * @see {@link http://hl7.org/fhir/R5/Endpoint-definitions.html#Endpoint.connectionType}
   */
  connectionType: Array<CodeableConcept>;
  _connectionType?: Element[] | undefined;

  /**
   * Contact details for a human to contact about the endpoint. The primary use of
   * this for system administrator troubleshooting.
   * @see {@link http://hl7.org/fhir/R5/Endpoint-definitions.html#Endpoint.contact}
   */
  contact?: Array<ContactPoint> | undefined;
  _contact?: Element[] | undefined;

  /**
   * The description of the endpoint and what it is for (typically used as
   * supplemental information in an endpoint directory describing its usage/purpose).
   * @see {@link http://hl7.org/fhir/R5/Endpoint-definitions.html#Endpoint.description}
   */
  description?: string | undefined;
  _description?: Element | undefined;

  /**
   * The type of environment(s) exposed at this endpoint (dev, prod, test, etc.).
   * @see {@link http://hl7.org/fhir/R5/Endpoint-definitions.html#Endpoint.environmentType}
   */
  environmentType?: Array<CodeableConcept> | undefined;
  _environmentType?: Element[] | undefined;

  /**
   * Additional headers / information to send as part of the notification.
   * Exactly what these mean depends on the channel type. The can convey additional
   * information to the recipient and/or meet security requirements.
   * @see {@link http://hl7.org/fhir/R5/Endpoint-definitions.html#Endpoint.header}
   */
  header?: Array<string> | undefined;
  _header?: Element[] | undefined;

  /**
   * Identifier for the organization that is used to identify the endpoint across
   * multiple disparate systems.
   * @see {@link http://hl7.org/fhir/R5/Endpoint-definitions.html#Endpoint.identifier}
   */
  identifier?: Array<Identifier> | undefined;
  _identifier?: Element[] | undefined;

  /**
   * The organization that manages this endpoint (even if technically another
   * organization is hosting this in the cloud, it is the organization associated
   * with the data).
   * This property is not typically used when searching for Endpoint resources for
   * usage. The typical usage is via the reference from an applicable
   * Organization/Location/Practitioner resource, which is where the context is
   * provided. Multiple Locations may reference a single endpoint, and don't have to
   * be within the same organization resource, but most likely within the same
   * organizational hierarchy.
   * @see {@link http://hl7.org/fhir/R5/Endpoint-definitions.html#Endpoint.managingOrganization}
   */
  managingOrganization?: Reference | undefined;
  _managingOrganization?: Element | undefined;

  /**
   * A friendly name that this endpoint can be referred to with.
   * @see {@link http://hl7.org/fhir/R5/Endpoint-definitions.html#Endpoint.name}
   */
  name?: string | undefined;
  _name?: Element | undefined;

  /**
   * The set of payloads that are provided/available at this endpoint.
   * Note that not all mimetypes or types will be listed under the one endpoint
   * resource, there may be multiple instances that information for cases where other
   * header data such as the endpoint address, active status/period etc. is
   * different.
   * @see {@link http://hl7.org/fhir/R5/Endpoint-definitions.html#Endpoint.payload}
   */
  payload?: Array<BackboneElement> | undefined;
  _payload?: Element[] | undefined;

  /**
   * The interval during which the endpoint is expected to be operational.
   * Temporary downtimes or other short-term changes in availability would not be
   * represented in this property.
   * @see {@link http://hl7.org/fhir/R5/Endpoint-definitions.html#Endpoint.period}
   */
  period?: Period | undefined;
  _period?: Element | undefined;

  /**
   * The endpoint status represents the general expected availability of an endpoint.
   * This element is labeled as a modifier because the status contains codes that
   * mark the endpoint as not currently valid. Temporary downtimes or other
   * unexpected short-term changes in availability would not be represented in this
   * property.
   * @see {@link http://hl7.org/fhir/R5/Endpoint-definitions.html#Endpoint.status}
   */
  status: string;
  _status?: Element | undefined;
}

