  _name?: Element[] | undefined;

  /**
   * This contact detail is handled/monitored by a specific organization. If the name
   * is provided in the contact, then it is referring to the named individual within
   * this organization.
   */
  organization?: Reference | undefined;
  _organization?: Element | undefined;

  /**
   * Period that this contact was valid for usage.
   * If the details have multiple periods, then enter in a new ExtendedContact with
   * the new period.
   */
  period?: Period | undefined;
  _period?: Element | undefined;

  /**
   * The purpose/type of contact.
   * If no purpose is defined, then these contact details may be used for any
   * purpose.
   */
  purpose?: CodeableConcept | undefined;
  _purpose?: Element | undefined;

