  /**
   * Indicates the mechanism used to compare versions to determine which is more
   * current.
   * If set as a string, this is a FHIRPath expression that has two additional
   * context variables passed in - %version1 and %version2 and will return a negative
   * number if version1 is newer, a positive number if version2 and a 0 if the
   * version ordering can't be successfully be determined.
   * @see {@link http://hl7.org/fhir/R5/SubscriptionTopic-definitions.html#SubscriptionTopic.versionAlgorithmCoding}
   */
  versionAlgorithmCoding?: Coding | undefined;
