/**
 * SubstanceNucleicAcid
 *
 * Nucleic acids are defined by three distinct elements: the base, sugar and
 * linkage. Individual substance/moiety IDs will be created for each of these
 * elements. The nucleotide sequence will be always entered in the 5’-3’ direction.
 *
 * @see {@link http://hl7.org/fhir/R5/SubstanceNucleicAcid.html}
 */
export interface SubstanceNucleicAcid extends DomainResource {
  readonly resourceType: "SubstanceNucleicAcid";

  /**
   * The area of hybridisation shall be described if applicable for double stranded
   * RNA or DNA. The number associated with the subunit followed by the number
   * associated to the residue shall be specified in increasing order. The underscore
   * “” shall be used as separator as follows: “Subunitnumber Residue”.
   * @see {@link http://hl7.org/fhir/R5/SubstanceNucleicAcid-definitions.html#SubstanceNucleicAcid.areaOfHybridisation}
   */
  areaOfHybridisation?: string | undefined;
  _areaOfHybridisation?: Element | undefined;

  /**
   * The number of linear sequences of nucleotides linked through phosphodiester
   * bonds shall be described. Subunits would be strands of nucleic acids that are
   * tightly associated typically through Watson-Crick base pairing. NOTE: If not
   * specified in the reference source, the assumption is that there is 1 subunit.
   * @see {@link http://hl7.org/fhir/R5/SubstanceNucleicAcid-definitions.html#SubstanceNucleicAcid.numberOfSubunits}
   */
  numberOfSubunits?: number | undefined;
  _numberOfSubunits?: Element | undefined;

  /**
   * (TBC).
   * @see {@link http://hl7.org/fhir/R5/SubstanceNucleicAcid-definitions.html#SubstanceNucleicAcid.oligoNucleotideType}
   */
  oligoNucleotideType?: CodeableConcept | undefined;
  _oligoNucleotideType?: Element | undefined;

  /**
   * The type of the sequence shall be specified based on a controlled vocabulary.
   * @see {@link http://hl7.org/fhir/R5/SubstanceNucleicAcid-definitions.html#SubstanceNucleicAcid.sequenceType}
   */
  sequenceType?: CodeableConcept | undefined;
  _sequenceType?: Element | undefined;

  /**
   * Subunits are listed in order of decreasing length; sequences of the same length
   * will be ordered by molecular weight; subunits that have identical sequences will
   * be repeated multiple times.
   * @see {@link http://hl7.org/fhir/R5/SubstanceNucleicAcid-definitions.html#SubstanceNucleicAcid.subunit}
   */
  subunit?: Array<BackboneElement> | undefined;
  _subunit?: Element[] | undefined;
}

